import React from 'react';
import './App.css';
import SimpleCard from './Card';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <Grid className="App">
      <SimpleCard />
      <SimpleCard />
      <SimpleCard />
      <SimpleCard />
      <SimpleCard />
    </Grid>
  );
}

export default App;
